<script>

function toggleDemoInfo() {
var element = document.getElementById("opened-info");
element.classList.toggle("opened");
}

function openDemoIframe() {
window.addEventListener("message", receiveMessage, false);
var element = document.querySelector(".accounts-popup .loading-container");
var iframeElement = document.getElementById("accounts-iframe");
var popupElement = document.querySelector(".accounts-popup");

element.classList.add("show");
document.body.classList.add('no-scroll');
document.getElementsByTagName('html')[0].classList.add('no-scroll');
popupElement.classList.add("show");
window.location.hash = '#get-started';
let xhr = new XMLHttpRequest();
xhr.open('GET', 'https://demo-burgerbar.ucraft.net/papi/default/helper/getAlias');
xhr.send();
xhr.onload = function () {

    let url = 'https://accounts.ucraft.com/#/wizard';
    let alias = JSON.parse(xhr.response).data;

    if (alias) {
        url = url + '/choose-site-name/170/' + alias;
    }

    iframeElement.setAttribute("src", url);
};

function receiveMessage(event) {
    switch (event.data.action) {
        case 'close':
            popupElement.classList.remove("show");
            window.location.hash = '/';
            document.body.classList.remove('no-scroll');
            document.getElementsByTagName('html')[0].classList.remove('no-scroll');

            iframeElement.setAttribute("src", "");

            if (window.accountSystemLanguage !== null) {
                tryToRedirectToRightLanguage(window.accountSystemLanguage);
            }
            break;
        case 'redirect':
            window.open(event.data.url, '_blank');
            popupElement.classList.remove("show");
            window.location.hash = '/';
            document.body.classList.remove('no-scroll');
            document.getElementsByTagName('html')[0].classList.remove('no-scroll');
            iframeElement.setAttribute("src", "");
            break;
        case 'reload':
            window.location.reload();
            break;
        case 'loaded':
            element.classList.remove("show");
            break;
    }
}
}

window.addEventListener('load', function () {
let demoElement = document.querySelector(".demo-container");

if (demoElement) {
    let badgeHeight = demoElement.getBoundingClientRect().height;

    let lastBlock = document.querySelector(".main-layout > div:last-child");

    if (lastBlock) {
        lastBlock.style.paddingBottom = badgeHeight + 'px';
    }

}

if (window.location.hash.trim() == "#get-started") {
    openDemoIframe();
}

});

</script>




